const generateClients = (json) => {
    let tempArray = [];
    for(const [clientNumber, clientData] of Object.entries(json)){
        tempClients.push(<Client key={clientNumber} clientNumber={clientNumber} properties={clientData} onValueChange={changeValue}></Client>);
    }
    return tempArray;
}


export default generateClients;
